Tokia spaudos konferencija – tikras akibrokštas, mat jos metu bixai lipo ant stalų ir nufilmavo kvietimą į koncertą. Ne ką mažesniu akibrokštu tapo ir nuotrauka, pasiekusi žiniasklaidą likus vos kelioms valandoms iki koncerto –  Saulius Urbonavičius-Samas  repetavo visiškai nuogas. Tą jam esą teko daryti todėl, kad buvo išparduoti visi bilietai į koncertą, tad atvykus į „Siemens“ areną kiek nustebino organizatorių sprendimas – dalis arenos buvo paslėpta juodomis užuolaidomis, o scena sukonstruota kone viduryje erdvės. „Paskutiniu metu grodavome labai aiškią programą, kur nei penki procentai bixų kūrybos neatsispindėjo. Išgirsite tokių kūrinių, kurių niekas gal dar nebuvo girdėję. Per visą karjerą skaičiuojam 238 dainas“, – dar prieš koncertą skaičiavo bixų lyderis S. Urbonavičius-Samas. Trisdešimtmetį švenčianti grupė džiaugiasi, kad su jų muzika užaugo jau ne viena karta. Tai įrodo ir spalvinga minia, susirinkusi į koncertą: nuo jaunų iki gyvenimo skonių jau ragavusių. Į BIX koncertą susirinko garsūs svečiai: „Mes atiduosim šiandien viską iki pakutinio kraujo lašo, paskutinio prakaito lašo. Ačiū, kad esate su mumis“, – po pirmos dainos publikai tarė Samas. Šįvakar arenoje susirinko ištikimiausi bixų gerbėjai. Ir nors arenoje galima sutalpinti gerokai daugiau žmonių, sumažinus erdvę buvo sukurta iliuzija, jog arena sausakimša. Pristatydamas dar vieną dainą Samas sukėlė publikos juoką: „Lietuvoj šiuo metu  žiauriai  madinga apsišikt. Ir apsišika visi: nuo politikų iki selo, – kalbėjo Samas. – Todėl mes turim dainą, kad apsišikt madinga“. Beje, selas šiame sakinyje nuskambėjo ne atitiktinai, likus vos keliom valandoms iki koncerto pradžios, Egidijus Dragūnas SEL grupės feisbuko paskyroje pasidalijo mintimis, jog prieš koncertą Samo paviešinta nuotrauka yra netinkama komunikacija su savo gerbėjais  (apie tai skaitykite čia) . Nuo naujų dainų koncertą pradėjusi grupė žadėjo, jog per kelias valandas jie publikai padovanos visus geriausius hitus ir keliaus „nuo šių laikų iki taip, kaip buvo tada“. Audringai prasidėjęs koncertas netruko įkaitinti atmosferos. Minia kartu su bixais traukė priedainius, lingavo į ritmą ir šiltai sutiko kiekvieną Samo žodį. „Kiek aš čia matau pažįstamų, senų pažįstamų. Aš Jūsų žiauriai pasiilgau, – miniai kalbėjo Samas ir pridūrė, jog šiais laikais tiek skubėjimo, kad nebėra kada susitikti. – O kad taip susėst prie vieno stalo. Tebūnie čia tas stalas.“ Po šių žodžių minioje pabiro Samą palaikantys šūksniai. „Visiems reikalams mes turime po dainą. Ji seniai jau parašyta ir viskas vyksta taip, kaip parašyta“, – kitą dainą „Sex Revolution“ pristatė Samas, pabrėžęs, jog pastaruoju metu viena ryškiausių problemų – seksualinis priekabiavimas. Koncertui persiritus į antrąją pusę ant scenos pasirodė Igoris Kofas. Vyrai scenoje sudainavo dar 1991 metais įrašytą dainą „Akli kariai“. Netrukus scenoje pasirodė dar vienas bixų bičiulis – „G&G Sindikato“ narys Kastytis Sarnickas-Kastetas. Duetas miniai padovanojo dainą „2rnas“. Dar vieną dainą kartu su Samu sudainavo ir SKAMP'ai Vilius Alesius ir Viktora Diawara. Įkaitinęs atmosferą kone iki maksimumo, Samas pagaliau uždainavo ilgai publikos prašytų dainų: viena po kitos nuskambėjo legendinės „Vagis“ ir „Kas iš to“. Pastarosios metu publikos viduryje susirinkusieji kabinosi už vienas kito pečių ir sukosi ratu. Koncerto akimirkos: (function(d, s, i, r) {
